import React, { useState } from "react";

import { makeStyles } from "@material-ui/core/styles";
import Chip from "@material-ui/core/Chip";
import Snackbar from "@material-ui/core/Snackbar";
import List from "@material-ui/core/List";
import ListItem from "@material-ui/core/ListItem";
import Button from "@material-ui/core/Button";
import TextField from "@material-ui/core/TextField";
import InputLabel from "@material-ui/core/InputLabel";
import FormHelperText from "@material-ui/core/FormHelperText";
import FormControl from "@material-ui/core/FormControl";
import Select from "@material-ui/core/Select";
import NativeSelect from "@material-ui/core/NativeSelect";

const useStyles = makeStyles((theme) => ({
  root: {
    width: "100%",
    maxWidth: 720,
    "margin-left": "35%",
  },
  header: {
    "margin-left": "40%",
    "margin-top": "3%",
  },
  button: {
    "margin-top": "3%",
    "margin-left": "3%",
  },
  chip: {
    margin: "5px",
  },
  gridList: {
    height: 500,
    transform: "translateZ(0)",
  },
  formControl: {
    margin: theme.spacing(1),
    minWidth: 120,
  },
  selectEmpty: {
    marginTop: theme.spacing(2),
  },
  comp: (props) => ({
    background: props.backgroundColor,
  }),
}));

function validateName(n) {
  return n != null && n.length > 4 && n.length < 21;
}

function validateDescription(d) {
  return d === "" || d.length < 100;
}

function validateMessage(m) {
  return m != null && m.length > 14 && m.length < 501;
}
function validateViewable(v) {
  return v != null;
}
function validateEmail(e) {
  return e === "" || e.match(/^([\w.%+-]+)@([\w-]+\.)+([\w]{2,})$/i);
}
export default function GuestBook() {
  const classes = useStyles();

  const [name, setName] = React.useState("jiachen");
  const [description, setDescription] = React.useState("");
  const [message, setMessage] = React.useState(null);
  const [viewable, setViewable] = React.useState(false);
  const [contact, setContact] = React.useState("");

  return (
    <div>
      <h1>Welcome to my page, &nbsp;leave a message!</h1>
      <List className={classes.root}>
        <ListItem>
          <FormControl className={classes.formControl}>
            <TextField
              error={!validateName(name)}
              id="name"
              placeholder="your name"
              label=""
              value={name}
              onChange={(event) => setName(event.target.value)}
              margin="normal"
              variant="outlined"
            />
            <FormHelperText>What's your name?(required)</FormHelperText>
          </FormControl>
        </ListItem>
        <ListItem>
          <FormControl className={classes.formControl}>
            <TextField
              error={!validateDescription(description)}
              id="description"
              label=""
              value={description}
              onChange={(event) => setDescription(event.target.value)}
              margin="normal"
              variant="outlined"
            />
            <FormHelperText>Tell me something about yourself!</FormHelperText>
          </FormControl>
        </ListItem>
        <ListItem>
          <FormControl className={classes.formControl}>
            <TextField
              error={!validateMessage(message)}
              id="message"
              value={message}
              onChange={(event) => setMessage(event.target.value)}
              margin="normal"
              variant="outlined"
            />
            <FormHelperText margin="dense">
              Do you want your message to be public?
            </FormHelperText>
          </FormControl>
        </ListItem>
        <ListItem>
          <FormControl className={classes.formControl}>
            <NativeSelect
              value={viewable}
              onChange={(event) => setViewable(event.target.value)}
              inputProps={{
                name: "age",
                id: "age-native-helper",
              }}
            >
              <option aria-label="None" value="" />
              <option value={true}>Yes</option>
              <option value={false}>No</option>
            </NativeSelect>
            <FormHelperText>
              Do you want your message to be public?
            </FormHelperText>
          </FormControl>
        </ListItem>
        <ListItem>
          <FormControl className={classes.formControl}>
            <TextField
              id="email"
              label=""
              value={contact}
              onChange={(event) => setContact(event.target.value)}
              margin="normal"
              variant="outlined"
            />
            <FormHelperText>What's your email?(won't be posted)</FormHelperText>
          </FormControl>
        </ListItem>
      </List>
    </div>
  );
}
